import React from 'react'
import { Link } from 'react-router-dom'
import MarkerIcon from '../assets/marker.png'
import MarkerIconSelected from '../assets/marker-selected.png'

const Marker = ({ store, selected, onClick }) => {
    const icon = selected ? MarkerIconSelected : MarkerIcon;

    return (
        <Link to={`/store/${store?._id}`} onClick={onClick}>
            <div >
                <img src={icon} alt="ok" />
                <img src={store?.image} alt="mdi-cart-outline"
                    className="img-marker" />
            </div>
        </Link>
    );
}

export default Marker;
